INSERT INTO `issue_description_template` VALUES (1,'bug','\r\n这里输入对bug做出清晰简洁的描述.\r\n\r\n**重现步骤**\r\n1. xx\r\n2. xxx\r\n3. xxxx\r\n4. xxxxxx\r\n\r\n**期望结果**\r\n简洁清晰的描述期望结果\r\n\r\n**实际结果**\r\n简述实际看到的结果，这里可以配上截图\r\n\r\n\r\n**附加说明**\r\n附加或额外的信息\r\n',0,1562299460),(2,'新功能','**功能描述**\r\n一句话简洁清晰的描述功能，例如：\r\n作为一个<用户角色>，在<某种条件或时间>下，我想要<完成活动>，以便于<实现价值>\r\n\r\n**功能点**\r\n1. xx\r\n2. xxx\r\n3. xxxx\r\n\r\n**规则和影响**\r\n1. xx\r\n2. xxx\r\n\r\n**解决方案**\r\n 解决方案的描述\r\n\r\n**备用方案**\r\n 备用方案的描述\r\n\r\n**附加内容**\r\n\r\n',0,1562300466),(3,'会议接机','--教授预计将于--月--日--点到达--机场--航站楼，航班号为--。请--同学前往接机。\r\n注意保存登机牌作为报销单据。\r\n--教授预定的酒店时--酒店，在接到教授后送到酒店即可。\r\n注意保存出租车发票或电子发票作为报销单据。',1572177896,0),(4,'会议送机','--教授预计将于--月--日--点从--机场--航站楼出发，航班号为--。教授所在的酒店是--酒店，请--同学适当提前一段时间前往送机。\r\n注意保存登机牌照片作为报销单据。\r\n注意保存出租车发票或电子发票作为报销单据。',1572177997,0),(5,'会议邀请函','主要研究--的--教授预计将于--月--日来我校访问，请准备一份会议邀请函，并找学院签字盖章。',1572178085,0),(6,'会议海报','--教授预计将于--月--日--点为师生在--教室做一场报告，主要关于--课题。详细内容见附件，请--同学制作一份报告海报用作宣传。',1572178166,0);
